const objParallaxArray=r=>{gsap.registerPlugin(ScrollTrigger),gsap.utils.toArray(r).forEach((function(r){gsap.from(r,{duration:.1,ease:"power1.out",opacity:0,yPercent:0,scrollTrigger:{trigger:r,scrub:.3,start:"-=600",end:"top bottom",toggleActions:"restart pause reverse pause",immediateRender:!1}})}))};objParallaxArray(".papers__item");